import React from "react";
import { Navigate, useParams } from "react-router-dom";

import "./Item.css";

const Item = ({items}) => {
  let {itemId} = useParams();
  const findItem = (id) => {
    return items.find((item) => item.id === id);
  };
  return (    
    <div>
      <h1>{findItem(itemId).id}</h1>
    </div>
  );
};

export default Item;
